import React, { useState } from 'react';

const Header = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const openMenu = () => setMenuOpen(true);
  const closeMenu = () => setMenuOpen(false);

  useEffect(() => {
    const element = document.querySelector(".heading-1");
    const text = "Frontend Developer";
    let index = 0;
    let isDeleting = false;

    const typeEffect = () => {
      if (!isDeleting && index <= text.length) {
        element.textContent = text.substring(0, index);
        index++;
      } else if (isDeleting && index >= 0) {
        element.textContent = text.substring(0, index);
        index--;
      }

      if (index === text.length) {
        isDeleting = true;
        setTimeout(typeEffect, 1000); // Pause after completing
        return;
      } else if (index === 0) {
        isDeleting = false;
      }

      setTimeout(typeEffect, isDeleting ? 100 : 150); // Typing and deleting speed
    };

    typeEffect();
  }, []);

  return (
    <div> {/* Parent wrapper div */}
      <div className="mouse-dot"></div>

      <div className="gradient-container">
        <header id="header" className="relative">
          {/* Hamburger Menu Button */}
          <a
            href=" "
            onClick={openMenu}
            id="fa-bars"
            className={`open ${menuOpen ? 'hidden' : ''}`}
          >
            <svg
              xmlns="http://www.w3.org/2000/svg"
              height="24px"
              viewBox="0 -960 960 960"
              width="24px"
              fill="#e8eaed"
            >
              <path d="M120-240v-80h720v80H120Zm0-200v-80h720v80H120Zm0-200v-80h720v80H120Z" />
            </svg>
          </a>

          {/* Side Menu */}
          <div id="sidemenu" className={`hidden-menu ${menuOpen ? 'block' : 'hidden'}`}>
            <div>
              <a href=" " id="fa-times" onClick={closeMenu}>
                <svg
                  xmlns="http://www.w3.org/2000/svg"
                  height="24px"
                  viewBox="0 -960 960 960"
                  width="24px"
                  fill="#e8eaed"
                >
                  <path d="m256-200-56-56 224-224-224-224 56-56 224 224 224-224 56 56-224 224 224 224-56 56-224-224-224 224Z" />
                </svg>
              </a>
            </div>
            <div><a href="#header">Home</a></div>
            <div><a href="#about">About</a></div>
            <div><a href="#services">Services</a></div>
            <div><a href="#skill">Skill</a></div>
            <div><a href="#portfolio">Portfolio</a></div>
            <div><a href="#contact">Contact</a></div>
          </div>

          {/* Navbar */}
          <ul className="navbar">
            <li>
              <a href="#header" className="hideonmobile home">
                <span className="initial">Home</span>
                <span className="new">Home</span>
              </a>
            </li>
            <li>
              <a href="#about" className="hideonmobile home">
                <span className="initial">About</span>
                <span className="new">About</span>
              </a>
            </li>
            <li>
              <a href="#services" className="hideonmobile home">
                <span className="initial">Services</span>
                <span className="new">Services</span>
              </a>
            </li>
            <li>
              <a href="#skill" className="hideonmobile home">
                <span className="initial">Skills</span>
                <span className="new">Skills</span>
              </a>
            </li>
            <li>
              <a href="#portfolio" className="hideonmobile home">
                <span className="initial">Portfolio</span>
                <span className="new">Portfolio</span>
              </a>
            </li>
            <li>
              <a href="#contact" className="hideonmobile home">
                <span className="initial">Contact</span>
                <span className="new">Contact</span>
              </a>
            </li>
          </ul>
        </header>
        <div className='intro'>
            <h1>Hi, It's Hamza</h1>
            <h3 className='heading-3'>And I'm a<span className='heading-1'>Frontend Developer</span></h3>
            <div className='buttons'><a href='My Resume.pdf' className='btn'>
            <span className='initial'>Download CV</span>
            <span className='new'>Download CV</span>
            </a>
            </div>
            <div className='side-icon'>
                <a href='https://www.facebook.com/m.hamza.rao1608' className='hidden'>
                    <i className='fa fa-brands fa-facebook'></i>
                </a>
                <a href='https://www.instagram.com/m.hamza.rao1608/' className='hidden'>
                    <i className='fa fa-brands fa-instagram'></i>
                </a>
                <a href='https://www.linkedin.com/in/rao-hamza-920a04246/' className='hidden'>
                    <i className='fa fa-brands fa-linkedin'></i>
                </a>
                <a href='https://github.com/Hamxa52' className='hidden'>
                    <i className='fa fa-brands fa-github'></i>
                </a>
            </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
